import React,{useState} from 'react'

const Use = () => {
    const [count, setcount] = useState(0)
    const countinc=()=>{
        setcount(count+1)
    }
  return (
    <><div>
    <h1>Count:{count}</h1>
    <button onClick={countinc}>clcik</button>
    </div></>


  )
}

export default Use
